export var ValueColor;
(function (ValueColor) {
    /**
     * Critical value color.
     */
    ValueColor["Critical"] = "Critical";
    /**
     * Error value color.
     */
    ValueColor["Error"] = "Error";
    /**
     * Good value color.
     */
    ValueColor["Good"] = "Good";
    /**
     * Neutral value color.
     */
    ValueColor["Neutral"] = "Neutral";
    /**
     * None value color.
     * _Note_: The None value color is set to prevent the display of tooltip 'Neutral' for numeric content.
     */
    ValueColor["None"] = "None";
})(ValueColor || (ValueColor = {}));
